(require '[clojure.string :as string])
(use 'clojure.walk)

(def bool-values {true  1
                  false 0})

(defn has-char-at-index
  [input
   index
   expected-char]
  (and (not (or (< index 0) (>= index (count input)))) (= (nth input index) expected-char))
  )

(defn find-xmas-shape-from-letters-at
  [index
   input
   row-length]
  (let [current (nth input index)]
    (if (not (= current \A))
      0
      (get bool-values (and
                         (< (mod index row-length) (- row-length 1))
                         (> (mod index row-length) 0)
                         (or
                           (and (has-char-at-index input (+ index row-length 1) \M) (has-char-at-index input (- index row-length 1) \S) (has-char-at-index input (+ index row-length -1) \M) (has-char-at-index input (- index row-length -1) \S))
                           (and (has-char-at-index input (+ index row-length 1) \M) (has-char-at-index input (- index row-length 1) \S) (has-char-at-index input (+ index row-length -1) \S) (has-char-at-index input (- index row-length -1) \M))
                           (and (has-char-at-index input (+ index row-length 1) \S) (has-char-at-index input (- index row-length 1) \M) (has-char-at-index input (+ index row-length -1) \M) (has-char-at-index input (- index row-length -1) \S))
                           (and (has-char-at-index input (+ index row-length 1) \S) (has-char-at-index input (- index row-length 1) \M) (has-char-at-index input (+ index row-length -1) \S) (has-char-at-index input (- index row-length -1) \M))
                           )
                         )
           )
      )
    ))

(defn count-xmas-in-line-starting-at
  [index
   input
   row-length]
  (let [current (nth input index)]
    (if (not (= current \X))
      0
      (reduce + [(get bool-values (and (< (mod index row-length) (- row-length 3)) (has-char-at-index input (+ index 1) \M) (has-char-at-index input (+ index 2) \A) (has-char-at-index input (+ index 3) \S)))
                 (get bool-values (and (> (mod index row-length) 2) (has-char-at-index input (- index 1) \M) (has-char-at-index input (- index 2) \A) (has-char-at-index input (- index 3) \S)))
                 (get bool-values (and (has-char-at-index input (+ index row-length) \M) (has-char-at-index input (+ index row-length row-length) \A) (has-char-at-index input (+ index row-length row-length row-length) \S)))
                 (get bool-values (and (has-char-at-index input (- index row-length) \M) (has-char-at-index input (- index row-length row-length) \A) (has-char-at-index input (- index row-length row-length row-length) \S)))
                 (get bool-values (and (< (mod index row-length) (- row-length 3)) (has-char-at-index input (+ index row-length 1) \M) (has-char-at-index input (+ index row-length row-length 2) \A) (has-char-at-index input (+ index row-length row-length row-length 3) \S)))
                 (get bool-values (and (> (mod index row-length) 2) (has-char-at-index input (+ index row-length -1) \M) (has-char-at-index input (+ index row-length row-length -2) \A) (has-char-at-index input (+ index row-length row-length row-length -3) \S)))
                 (get bool-values (and (> (mod index row-length) 2) (has-char-at-index input (- index row-length 1) \M) (has-char-at-index input (- index row-length row-length 2) \A) (has-char-at-index input (- index row-length row-length row-length 3) \S)))
                 (get bool-values (and (< (mod index row-length) (- row-length 3)) (has-char-at-index input (- index row-length -1) \M) (has-char-at-index input (- index row-length row-length -2) \A) (has-char-at-index input (- index row-length row-length row-length -3) \S)))])
      )
    )
  )

(defn traverse
  [find-function
   input]
  (let [row-length (string/index-of input "\n")
        sanitized (string/replace input "\n" "")
        size (count sanitized)]
    (loop [index 0
           result 0
           ]
      (if (= size index)
        result
        (recur (inc index) (+ result (find-function index sanitized row-length)))
        )

      )
    )
  )

(println (traverse count-xmas-in-line-starting-at "MMMSXXMASM\nMSAMXMSMSA\nAMXSXMAAMM\nMSAMASMSMX\nXMASAMXAMM\nXXAMMXXAMA\nSMSMSASXSS\nSAXAMASAAA\nMAMMMXMMMM\nMXMXAXMASX"))
